function Home() {
  return <div>Welcome to celke!</div>
}

export async function getServerSideProps(){
  try {
    const response = await fetch(`http://localhost:8080/metas`);
    console.log(response);
    const data = await response.json();
    console.log(data);
    return {props:{data}}
  } catch (error) {
    return {
      notFound: true,
      error: `Dados não encontrados ${error}`
    } 
  }
  
}
export default Home
